export const SwiperNav = () => {
  const [slides, setSlides] = useState([
    { id: 1, name: 'Slide 1', link: 'https://example.com' },
    { id: 2, name: 'Slide 2', link: 'https://example.com' },
    { id: 3, name: 'Slide 3', link: 'https://example.com' },
    { id: 4, name: 'Slide 4', link: 'https://example.com' }
  ]);

  const [formOpen, setFormOpen] = useState(false);
  const [newSlideName, setNewSlideName] = useState('');
  const [newSlideLink, setNewSlideLink] = useState('');

  const handleAddPage = () => {
    setFormOpen(true);
  };

  const handleSubmitForm = (e) => {
    e.preventDefault();
    const updatedSlides = [...slides, { id: slides.length + 1, name: newSlideName, link: newSlideLink }];
    setSlides(updatedSlides);
    setFormOpen(false);
    setNewSlideName('');
    setNewSlideLink('');
  };

  return (
    <>
      <Swiper
        slidesPerView={3}
        spaceBetween={30}
        navigation={true}
        modules={[Pagination, Navigation]}
      >
        {slides.map((slide) => (
          <SwiperSlide key={slide.id}>
            <CustomSwiperSlide>
              <AddButton onClick={handleAddPage}>+</AddButton>
              <a href={slide.link} target="_blank" rel="noopener noreferrer">{slide.name}</a>
            </CustomSwiperSlide>
          </SwiperSlide>
        ))}
      </Swiper>

      <Form isOpen={formOpen} onSubmit={handleSubmitForm}>
        <label>
          Nome da Página:
          <input type="text" value={newSlideName} onChange={(e) => setNewSlideName(e.target.value)} required />
        </label>
        <label>
          Link da Página:
          <input type="text" value={newSlideLink} onChange={(e) => setNewSlideLink(e.target.value)} required />
        </label>
        <button type="submit">Salvar</button>
      </Form>
    </>
  );
};
